    return (
        <>

            <Row className="footer">




                <Col className="col">
                    <img src={IBA} alt="IBA" />
                    <h5>All copy rights are reserved by Sukkur IBA University</h5>
                </Col>
            </Row>


        </>
    );

}

export default Footer;
